変換コネクター　SMA→MCX<br>
アンテナ同軸用SMA型コネクターをMCX型コネクターに変換します。<br>
MCX型コネクターはスナップオン/プルオフ結合の小型コネクターで、<br>
省スペースの取付け設計が可能です。<br><br><br>
変換コネクター　MCX→SMA<br>
アンテナ同軸用MCX型コネクターをSMA型コネクターに変換します。<br>
SMA型コネクターはマイクロウェーブ帯域で安定した<br>
伝送特性を持つネジ固定式の小型同軸コネクターです。<style type="text/css">
